{

  .new_post_label
  {
    font-size: 0 !important;
  }

  .new_post_label > I:before
  {
    content: none !important;
  }

  #new_post
  {
    background: url('https://68.media.tumblr.com/36c4140c6f89043ac18d0ca7663a103a/tumblr_ovsht63W4S1wv0m5ho1_r3_540.png') center no-repeat white !important;
  }
}
